define('text!views/english/membership.html',[],function () { return '<div class="container">\r\n\r\n    <div class="row-fluid privacy text-left" style="direction: ltr">\r\n\r\n        <h4>Membership</h4>\r\n        <p>\r\n            Every licensed ham of age 17 or more is eligible of membership in IARC.<br />\r\n            Additionally, the members committee can approve admission in a state of "friendship". An IARC friend can be for example someone who is not 17 years old yet, or is not a citizen of the state of Israel, or is a club station, or a corporate. A friend is eligible of most of members\' privileges, notably except the rights to elect or be elected to IARC\'s institutes.<br />\r\n            For enrolling, either <a href="#Contact">contact us</a>, or by email at <a href="mailto:membership@iarc.org">membership@iarc.org</a><br />\r\n            For any question about membership fees, you can also contact the treasurer at <a href="mailto:treasurer@iarc.org">treasurer@iarc.org</a><br />\r\n        </p>\r\n        <hr />\r\n        <h4>Membership fees for Israeli residents</h4>\r\n        <p>Membership fees for Israeli residents are:</p>\r\n        <ul>\r\n            <li>250 NIS for a person</li>\r\n            <li>300 NIS for families and club stations</li>\r\n            <li>150 NIS for Youth and Israeli troops</li>\r\n        </ul>\r\n        <p>Paying the membership fees can be done either in person (by arriving to the IARC offices or by meeting the treasurer), by mail (by sending a cheque) or by Bank transfer.</p>\r\n        <hr />\r\n        <h4>Membership fees for non-Israeli residents</h4>\r\n        <p>\r\n            Membership fees for non-Israeli residents are currently at 30 USD per year.\r\n        </p>\r\n    </div>\r\n    <!--/row-fluid-->\r\n\r\n</div>\r\n\r\n';});


