define('text!views/membership.html',[],function () { return '<div class="container">\r\n    <div class="row-fluid privacy">\r\n        <h4>חברות באגודה</h4>\r\n        <p>\r\n            רשאי להיות חבר אגודה כל חובב רדיו מעל גיל 17 המגיש בקשה להתקבל לאגודה.\r\n            בנוסף, ועדת חברים יכולה לאשר קבלה לאגודה במעמד של ידיד אגודה. ידיד אגודה יכול להיות מי שלא מלאו לו 17 שנה, או שאינו אזרח מדינת ישראל, או מועדון חובבי רדיו, או תאגיד. לידידי האגודה רוב הזכויות של חברי האגודה, למעט הזכות לבחור ולהיבחר למוסדות האגודה.\r\n            ע"מ להרשם לאגודה, צור קשר <a href="#Contact">כאן</a>, או בדוא"ל <a href="mailto:membership@iarc.org">membership@iarc.org</a> או באמצעות <a href="#Register" target="_blank">טופס ההצטרפות</a>.<br />\r\n            החברות באגודה מתוארת ומוגדרת בתקנון האגודה.\r\n        </p>\r\n        <ul>\r\n            <li><a href="././Content/docs/IARC_Policy_2008.pdf" target="_blank">תקנון האגודה</a></li>\r\n        </ul>\r\n        <hr />\r\n        <h4>דמי חבר עבור תושבי ישראל</h4>\r\n        <label>דמי החבר ישמשו למימון שירותי האגודה אשר ניתנים לחבריה.</label>\r\n        <p>דמי החבר עבור תושבי ישראל הינם:</p>\r\n        <ul>\r\n            <li>250 ש"ח לאדם</li>\r\n            <li>300 ש"ח עבור משפחות ותחנות מועדון</li>\r\n            <li>150 ש"ח עבור נוער וחיילים</li>\r\n        </ul>\r\n        <!--<p>תשלום דמי החבר יכול להתבצע פנים-מול-פנים (ע"י הגעה למשרדי האגודה, או ע"י פגישת הגזבר), באמצעות דואר (ע"י שליחת המחאה) או ע"י הפקדה לחשבון.</p>-->\r\n        <label>ניתן לשלם את דמי החבר במספר אופנים:</label>\r\n        <ol>\r\n            <li>פנים אל פנים עם הגזבר בפגישה במשרדי האגודה: רחוב אלפרט 3 יהוד, או במפגש שהאגודה מקיימת מפעם לפעם.</li>\r\n            <li>המחאה בדואר אל משרדי האגודה לכתובת:    אגודת חובבי הרדיו בישראל (ע"ר) ת.ד. 17600 תל אביב מיקוד 6117501</li>\r\n            <li>\r\n                בנקאית אל חשבון האגודה:\r\n                <div class="tag-box tag-box-v2">\r\n                    פרטי החשבון:<br />\r\n                    אגודת חובבי הרדיו בישראל,<br />\r\n                    בנק לאומי (10),<br />\r\n                    מס\' חשבון 02986919,<br />\r\n                    סניף תל גנים 988,<br />\r\n                    גבעתיים, ישראל.\r\n                </div>\r\n            </li>\r\n        </ol>\r\n        במידה ובחרת בדרך זו (העברה בנקאית) אנא שלח מייל אל הגזבר treasurer@iarc.org וצרף צילום אישור ההעברה על מנת להקל על הגזבר את\r\n        ניהול הרישום והקישור בין הסכום שהועבר לבין החובב המשלם.\r\n        <hr />\r\n        <h4>דמי חבר עבור תושבי חוץ</h4>\r\n        <p>\r\n            דמי חבר עבור תושבים זרים הינם כרגע 30 דולר ארה"ב לשנה.\r\n        </p>\r\n    </div>\r\n    <!--/row-fluid-->\r\n</div>\r\n';});


