define('text!views/pa.html',[],function () { return '<div class="container">\r\n\r\n    <div class="row-fluid privacy">\r\n\r\n        <h4>האיזור האישי</h4>\r\n        <p>\r\n            לחברים שלום,<br />\r\n            לאגודה אתר וכן דף פייסבוק אבל אילו לא קשורים ישירות לניהול בסיס הנתונים האישי של החובב החבר. לצורך ניהול בסיס הנתונים האישי של החבר, המזכיר מקיים מאגר של האגודה שיושב על שרת האגודה.<br /><br />\r\n            לכל חבר באגודה הוקצה בשרת איזור אישי משלו כשהשדה המוביל הוא אות הקריאה. מטרת האזור האישי לאפשר לחובב שירות אינטראקטיבי ובכלל זה עדכון פרטים אישיים יזום על ידי החובב ואפשרות לקריאה ואף הורדה של הגל במהדורה האלקטרונית.<br />\r\n            בכניסה מקבלים מסך שמבקש זיהוי (זהו אות הקריאה כפי שרשום באגודה) וכן מתבקשים למלא סיסמא שאותה המזכיר מנפיק לאור פניה אליו והיא ראשונית והחובב יכול לשנותה. אם הסיסמא נשכחה המזכיר יכול לאפס לסיסמא זמנית חדשה אבל לא לשחזר.<br /><br />\r\n            לסיכום - כדי להכנס לאזור האישי:<br />\r\n            לחץ על הקישור: <a href="http://www.iarc.org/pa" target="_blank">איזור אישי</a><br />\r\n            שם המשתמש - הוא האות קריאה.<br />\r\n            הסיסמא - היא הסיסמא שבחר החבר להשתמש אחרי ששינה את הסיסמא הזמנית שקיבל.<br /><br />\r\n            בהצלחה,<br />\r\n            מזכיר האגודה.<br />\r\n        </p>\r\n    </div>\r\n    <!--/row-fluid-->\r\n\r\n</div>\r\n\r\n';});


